import styled from 'styled-components'

export const Wrapper = styled.div`
  margin: 2em 0;
  padding: 2.4em 2em;

  display: flex;
  flex-direction: column;
  align-items: center;

  background-color: #ffffff;

  box-shadow: 0 2.778rem 4.944rem 0 rgba(0, 6, 70, 0.03);
`

export const Img = styled.img`
  width: 30%;
  height: auto;
`
